import styled from "styled-components";
import { primaryColor } from "../constants/colors";

export const ButtonForm = styled.button`
    width: 320px;
    height: 60px;
    border-radius: 8px;
    background-color: ${primaryColor};
    cursor: pointer;
    font-weight: 700;
    font-size: 22px;

`
